function MatchupPage()
{
  const [teams, setTeams] = useState([]);


  useEffect(() => {
    const url = "/home/:teams";

    const fetchData = async () => {
      try
      {
        const response = await fetch(url);
        const data = await response.json();
        setTeams(data);
      }
      catch (error)
      {
        console.log("error", error);
      }
    };

    fetchData();
  }, []);






  function setWeeklyMatchups()
  {
    return(
            teams.map(team =>
              <tr key={team.toString()}>
                <td className="matchups">
                  <button className="button" onClick={() => matchup(team)}>
                    {setHomeTeam(team)}@{setAwayTeam(team)}
                  </button>
                </td>
              </tr>
            )
          )
  }


  return (
    <>
    <h1>
      Money Maker
    </h1>

    <h3>
      The AI that predicts every NFL game
    </h3>

    <table className="allTeams">
      <tbody>

        <tr>
          <th >Week 1 Match ups</th>
        </tr>

        {setWeeklyMatchups()}

      </tbody>
    </table>
    </>
  );
}

export default NewHome;
